    "willapa-nwr-initial-survey-instructions-for-tidal-restoration-monitoring-avian-surveys",nt"isopen":
    false,nt"url": null,nt"notes": "Key ecosystem processes are changed when
    saltwater influence is restored to formerly diked areas. This includes tidal hydrology,
    cycling of organic matter and nutrients, and sediment movements. New off-channel
    habitat is made available to fish. Plant communities recolonize and grow making
    organic matter and prey items available. The ongoing restoration of over 200 ha
    of estuarine habitat on Willapa National Wildlife Refuge (Willapa NWR) is expected
    to benefit a variety of species including migrating shorebirds, overwintering waterbirds,
    and salmonids that use estuarine and tidal marshes as rearing and feeding areas.Pre-restoration
    baseline data characterizing channel morphology, sediments, general site conditions
    (using aerial and oblique photographs), tidal range, and vegetation were collected
    along with historic data on avian, fish, and invertebrate occurrence. Post-restoration
    monitoring will guide refuge habitat management and provide valuable information
    for similar habitat restoration projects.",nt"license_title": "License Not
